import axios from 'axios'
import React, { useEffect, useState } from 'react'
const Cart = () => {
    const [cartItem,setCartItem] = useState()
    useEffect(()=>{
        axios.get('http://localhost:3003/getcartitems').then(res=>setCartItem([...res.data])).catch(err=>console.log(err))
    },[])
  return (
    <div>
        {cartItem.map(item=>
            <div>
            {item.Dname}
            </div>
        )}

    </div>
  )
}

export default Cart
